import React from 'react';
import { createStackNavigator, HeaderTitle } from '@react-navigation/stack';
import Home from '../Screens/Home';
import DisplayWeapons from '../Screens/DisplayWeapons'
import RandomGun from '../Screens/RandomGun'

import SkinSearch from "../Screens/SkinSearch"
import SkinSearchResults from '../Screens/SkinSearchResults';
// 
const Stack = createStackNavigator();

const HomeScreenStack = props => {
    return(
        <Stack.Navigator title = {SkinSearch}>
            <Stack.Screen name = "Home" component = {Home} 
             options = {{headerTitle: props => <SkinSearch {...props}/>, headerStyle: {backgroundColor: '#747d8c'}}}
            />
            <Stack.Screen name = "Display Weapons" component = {DisplayWeapons} options = {{headerStyle: {backgroundColor: '#747d8c'}}}/>
            <Stack.Screen name = "Random Gun" component = {RandomGun} options = {{headerStyle: {backgroundColor: '#747d8c'}}}/>
            <Stack.Screen name = "Skin Search Results" component = {SkinSearchResults} options = {{headerStyle: {backgroundColor: '#747d8c'}}}/>
        </Stack.Navigator>
    )
}
export {HomeScreenStack}
